import React, { useState } from "react";

export default function CarSearch() {
    const [site, setSite] = useState("sahibinden");
    const [marka, setMarka] = useState("Ford");
    const [model, setModel] = useState("Focus");
    const [yilMin, setYilMin] = useState(2015);
    const [yilMax, setYilMax] = useState(2020);
    const [fiyatMin, setFiyatMin] = useState(300000);
    const [fiyatMax, setFiyatMax] = useState(800000);
    const [vites, setVites] = useState("");
    const [yakit, setYakit] = useState("");

    const searchCars = () => {
        let url = "";

        if (site === "sahibinden") {
            const yakitMap = {
                "Benzin": "a3_1",
                "Benzin & LPG": "a3_2",
                "Dizel": "a3_3",
                "Hibrit": "a3_4",
                "Elektrikli": "a3_5"
            };
            const vitesMap = {
                "Manuel": "a4_1",
                "Otomatik": "a4_2"
            };

            url = `https://www.sahibinden.com/${marka.toLowerCase()}-${model.toLowerCase()}?`;
            if (yilMin) url += `a5_min=${yilMin}&`;
            if (yilMax) url += `a5_max=${yilMax}&`;
            if (fiyatMin) url += `price_min=${fiyatMin}&`;
            if (fiyatMax) url += `price_max=${fiyatMax}&`;
            if (yakit && yakitMap[yakit]) url += `${yakitMap[yakit]}=true&`;
            if (vites && vitesMap[vites]) url += `${vitesMap[vites]}=true&`;
        }
        else if (site === "arabam") {
            const yakitMap = {
                "Benzin": "1",
                "Dizel": "2",
                "Hibrit": "3",
                "Elektrik": "4",
                "LPG & Benzin": "5"
            };
            const vitesMap = {
                "Düz": "1",
                "Otomatik": "2",
                "Yarı Otomatik": "3"
            };

            url = `https://www.arabam.com/ikinci-el/${marka.toLowerCase()}/${model.toLowerCase()}?`;
            if (fiyatMin) url += `priceMin=${fiyatMin}&`;
            if (fiyatMax) url += `priceMax=${fiyatMax}&`;
            if (yilMin) url += `yearMin=${yilMin}&`;
            if (yilMax) url += `yearMax=${yilMax}&`;
            if (yakit && yakitMap[yakit]) url += `fuelType=${yakitMap[yakit]}&`;
            if (vites && vitesMap[vites]) url += `gear=${vitesMap[vites]}&`;
        }

        url = url.replace(/&$/, "");
        window.open(url, "_blank");
    };

    return (
        <div className="search-container">
            <h2>Araba Arama</h2>

            <label>Site:</label>
            <select value={site} onChange={(e) => setSite(e.target.value)}>
                <option value="sahibinden">Sahibinden.com</option>
                <option value="arabam">Arabam.com</option>
            </select>

            <label>Marka:</label>
            <input type="text" value={marka} onChange={(e) => setMarka(e.target.value)} />

            <label>Model:</label>
            <input type="text" value={model} onChange={(e) => setModel(e.target.value)} />

            <label>Yıl (min):</label>
            <input type="number" value={yilMin} onChange={(e) => setYilMin(e.target.value)} />

            <label>Yıl (max):</label>
            <input type="number" value={yilMax} onChange={(e) => setYilMax(e.target.value)} />

            <label>Fiyat (min):</label>
            <input type="number" value={fiyatMin} onChange={(e) => setFiyatMin(e.target.value)} />

            <label>Fiyat (max):</label>
            <input type="number" value={fiyatMax} onChange={(e) => setFiyatMax(e.target.value)} />

            <label>Vites:</label>
            <select value={vites} onChange={(e) => setVites(e.target.value)}>
                <option value="">Seçiniz</option>
                <option value="Manuel">Manuel</option>
                <option value="Otomatik">Otomatik</option>
                <option value="Düz">Düz (Arabam)</option>
                <option value="Yarı Otomatik">Yarı Otomatik</option>
            </select>

            <label>Yakıt:</label>
            <select value={yakit} onChange={(e) => setYakit(e.target.value)}>
                <option value="">Seçiniz</option>
                <option value="Benzin">Benzin</option>
                <option value="Benzin & LPG">Benzin & LPG</option>
                <option value="Dizel">Dizel</option>
                <option value="Hibrit">Hibrit</option>
                <option value="Elektrikli">Elektrikli</option>
                <option value="LPG & Benzin">LPG & Benzin (Arabam)</option>
            </select>

            <button onClick={searchCars}>Ara</button>
        </div>
    );
}
